```cpp
class Solution {
public:
    vector<vector<int>> kClosest(vector<vector<int>>& points, int K) {
        priority_queue<pair<int, pair<int, int>>> maxHeap;
        for(auto point: points){
            int x = point[0], y = point[1];
            int dist = x*x + y*y;
            if(maxHeap.size() == K){
                if(maxHeap.top().first > dist){
                    maxHeap.pop();
                    maxHeap.push({dist, {x, y}});
                }
            }else{
                maxHeap.push({dist, {x, y}});
            }
        }

        vector<vector<int>> result;
        while(!maxHeap.empty()){
            result.push_back({maxHeap.top().second.first, maxHeap.top().second.second});
            maxHeap.pop();
        }
        return result;
    }
};
```
The buggy line was replaced with the correct comparison operation in the priority queue comparator. The distance of the points is calculated and a pair is pushed into the priority queue where the first element is the distance and the second element is a pair of x and y coordinates. If the size of the priority queue is equal to K i.e. we are at the Kth closest point, we compare the distance of the current point with the distance of the point at the top of the priority queue. If the distance of the current point is smaller, we remove the point at the top of the priority queue and push the current point into the priority queue. If the priority queue is not full, we directly push the point into the priority queue. In the end, we pop all points from the priority queue and push them into the result vector.
